function AIVisual() {
  return (
    <div style={{
      position: 'relative',
      width: '600px',
      height: '600px',
      perspective: '1000px',
    }}>
      {/* Floating Cards Stack */}
      <div style={{
        position: 'absolute',
        top: '50%',
        right: '100px',
        transform: 'translateY(-50%)',
        transformStyle: 'preserve-3d',
      }}>
        {/* Credit Cards - 3 layers */}
        {[0, 1, 2].map((index) => (
          <div
            key={index}
            style={{
              position: 'absolute',
              width: '400px',
              height: '250px',
              backgroundColor: index === 0 ? 'rgba(97, 218, 251, 0.2)' : 'rgba(255, 255, 255, 0.1)',
              borderRadius: '20px',
              transform: `translateZ(${-index * 40}px) translateY(${index * 20}px)`,
              backdropFilter: 'blur(10px)',
              border: '1px solid rgba(255, 255, 255, 0.2)',
              boxShadow: '0 0 30px rgba(97, 218, 251, 0.1)',
              transition: 'all 0.3s ease',
              animation: `floatCard ${2 + index * 0.5}s infinite ease-in-out`,
            }}
          >
            {index === 0 && (
              <>
                {/* Card Content for the top card */}
                <div style={{
                  position: 'absolute',
                  top: '20px',
                  left: '20px',
                  right: '20px',
                }}>
                  <img 
                    src="/bank-logo.png" 
                    alt="Bank Logo"
                    style={{
                      height: '30px',
                      marginBottom: '20px',
                    }}
                  />
                  <div style={{
                    width: '50px',
                    height: '40px',
                    backgroundColor: 'rgba(255, 255, 255, 0.1)',
                    borderRadius: '8px',
                    marginBottom: '40px',
                  }} />
                  <div style={{
                    color: '#fff',
                    fontSize: '18px',
                    letterSpacing: '2px',
                    marginBottom: '10px',
                  }}>
                    **** **** **** 5678
                  </div>
                </div>
              </>
            )}
          </div>
        ))}
      </div>

      {/* Robotic Hand */}
      <div style={{
        position: 'absolute',
        bottom: '50px',
        right: '150px',
        width: '300px',
        height: '200px',
        animation: 'floatHand 3s infinite ease-in-out',
      }}>
        <img 
          src="/robotic-hand.png" 
          alt="Robotic Hand"
          style={{
            width: '100%',
            height: '100%',
            objectFit: 'contain',
            filter: 'drop-shadow(0 0 20px rgba(97, 218, 251, 0.3))',
          }}
        />
      </div>

      {/* Floating Spheres */}
      {[
        { size: 80, top: '10%', right: '20%' },
        { size: 40, top: '60%', right: '10%' },
        { size: 20, top: '40%', right: '30%' },
      ].map((sphere, index) => (
        <div
          key={`sphere-${index}`}
          style={{
            position: 'absolute',
            width: `${sphere.size}px`,
            height: `${sphere.size}px`,
            backgroundColor: '#61DAFB',
            borderRadius: '50%',
            top: sphere.top,
            right: sphere.right,
            opacity: 0.8,
            boxShadow: '0 0 30px rgba(97, 218, 251, 0.5)',
            animation: `floatSphere ${2 + index}s infinite ease-in-out ${index * 0.5}s`,
          }}
        />
      ))}
    </div>
  );
}

export default AIVisual;
